const styles = () => ({
  attachmentsAccordion: {
    '& h4': {
      fontSize: '.85rem',
      fontWeight: 600,
    },
  },
  details: {
    flexWrap: 'wrap',
    paddingLeft: '35px',
    '& button': {
      margin: '5px',
    },
  },
  description: {
    width: '50%',
    marginBottom: '20px',
  },
  mainLinkStlying: {
    display: 'flex',
    marginTop: '-20px',
  },
  dividerStyling: {
    color: 'blue',
  },
  linkStyling: {
    color: 'blue',
    fontSize: '11.5px',
  },
});

export default styles;
